import Authorisation from "./pages/authorisation-page/Authorisation"
import HeaderBase from "./components/header/Header-base"

class App extends React.Component{
    render() {
        return (
            <div>
                <HeaderBody />
                    <div id="mainbody">
                        <Authorisation />
                    </div>
            </div>
        )
    }
}
export default App;
